import React, { Component } from 'react'
import {
    Header,
    Container,Segment
} from 'semantic-ui-react';
import Layout from './layout';
const Head = ()=>(
<Layout>    
    <Container text>
        <Segment
            inverted
            textAlign='center'
            style={{ minHeight: 50, padding: '1em 0em' }}
            vertical
            >
         <Header
      as='h1'
      content='Weather'
      inverted
      style={{
        fontSize:'4em',
        fontWeight: 'normal',
        marginBottom: 0,
        marginTop: '1.5em',
      }}
    />
    </Segment>
    </Container>
    </Layout>
)

export default Head
